// Deal with parameters passed to the page
// As parameters are mutually exclusive we only process the first parameter
// 
// http://www.babelstone.co.uk/Unicode/unicode70.html?name=Character Name
// http://www.babelstone.co.uk/Unicode/unicode70.html?find=string
// http://www.babelstone.co.uk/Unicode/unicode70.html?char=1234
// http://www.babelstone.co.uk/Unicode/unicode70.html?char=random
// 
function ProcessPageParams()
{
	var handled = false;

	if ( location.search )
	{
		var params = location.search.substring(1).split( "&" );
		var a = params[0].split( "=" );
		var param = a[0].toLowerCase();
		var value = unescape( a[1] );

		if ( param == "char" )
		{
			if ( value.toLowerCase() == "random" )
			{
				OnRandomCharacter();
			}
			else
			{
				document.getElementById( "gototext" ).value = value;
				OnGotoButton();
			}
			handled = true;
		}
		else if ( param == "find" )
		{
			document.getElementById( "searchtext" ).value = value;
			OnSearchButton();
			handled = true;
		}
		else if ( param == "name" )
		{
			document.getElementById( "searchcheck" ).checked = true;
			document.getElementById( "searchtext" ).value = value;
			OnSearchButton();
			handled = true;
		}
	}

	// Set to "X" initially if not otherwise specified
	if ( handled == false )
	{
		SetCharacter( 0, "0058" );
	}
}

// http://www.babelstone.co.uk/Unicode/whatisit70.html
// http://www.babelstone.co.uk/Unicode/whatisit70.html?convert=string
// http://www.babelstone.co.uk/Unicode/whatisit70.html?convert=string&prefix=true
// http://www.babelstone.co.uk/Unicode/whatisit70.html?convert=string&prefix=false
// 
function InitialiseConversion()
{
	// Get preferences if available
	var defaultFontSizeIndex = 2;
	var defaultFontColourIndex = 3;
	var defaultBackColourIndex = 0;
	var defaultHighColourIndex = 6;
	var defaultFontMappingIndex = 0;
	var defaultFontName = "";

	var cookieWhatIsItPrefix = ReadCookie( "WhatIsItPrefix" );

	if ( cookieWhatIsItPrefix != null )
	{
		document.getElementById( "codecheck" ).checked = ( cookieWhatIsItPrefix == "true" );
	}

	if ( location.search )
	{
		var params = location.search.substring(1).split( "&" );
		var a = params[0].split( "=" );
		var param1 = a[0].toLowerCase();
		var value1 = unescape( a[1] );

		if ( params[1] )
		{
			var b = params[1].split( "=" );
			var param2 = b[0].toLowerCase();
			var value2 = unescape( b[1] );

			if ( ( param2 == "prefix" ) && ( value2 == "true" ) )
			{
				document.getElementById( "codecheck" ).checked = true;
			}
		}

		if ( param1 == "convert" )
		{
			document.getElementById( "edittextin" ).value = value1;
			OnConvertCharactersToNames();
		}
	}
}

function FinaliseConversion()
{
	// Store current state
	WriteCookie( "WhatIsItPrefix", document.getElementById( "codecheck" ).checked, CookieDuration );
}

