// http://www.babelstone.co.uk/Unicode/babelmap70.html
// http://www.babelstone.co.uk/Unicode/babelmap70.html?block=Block Name
// http://www.babelstone.co.uk/Unicode/babelmap70.html?char=1234
// http://www.babelstone.co.uk/Unicode/babelmap70.html?name=Character Name
// http://www.babelstone.co.uk/Unicode/babelmap70.html?find=string
// 
function ProcessBabelMapParams()
{
	if ( location.search )
	{
		var params = location.search.substring(1).split( "&" );
		var a = params[0].split( "=" );
		var param = a[0].toLowerCase();
		var value = unescape( a[1] );

		if ( param == "block" )
		{
			value = value.toLowerCase();
			for ( b = 0; b < NumBlocks; b++ )
			{
				if ( BlockName[b].toLowerCase() == value )
				{
					WriteChart( b );
					break;
				}
			}
		}
		else if ( param == "char" )
		{
			document.getElementById( "gototext" ).value = value;
			OnGotoCharacter();
		}
		else if ( param == "find" )
		{
			document.getElementById( "searchtext" ).value = value;
			OnSearchCharacter();
		}
		else if ( param == "name" )
		{
			document.getElementById( "searchcheck" ).checked = true;
			document.getElementById( "searchtext" ).value = value;
			OnSearchCharacter();
		}
	}
}

